import Images from './../components/images';

const temp = Array(6).fill(null);

function Poster(props) {
    return (
        <div className="poster">
            <img 
                src={Images.wallPoster}
                className="w-full h-auto"
            />
        </div>
    )
}


export default () => {
    return (        
        temp.map((_, i) => <Poster key={i} />)
    )
}
